    /**
     * 刷新数据
     * @param dt
     * @param roomGroup
     */
    function refreshPageData(dt, roomGroup) {
        dt = eval("(" + dt + ")");
            if (dt && dt.groupName == 'push_ips') {
            var data2 = [];
            for (var i = 0; i < dt.ips.length; i++) {
                var geoCoord = dt.ips[i];
                data2.push({
                    geometry: {
                        type: 'Point',
                        coordinates: geoCoord
                    },
                    time: Math.random() * 10
                });
            }
            dataPointSet.set(data2);
            dataShineSet.set(data2);
        }
    }